import { authService } from './authService';
import { AuthRequest } from './models';

export const authRequestLogin = (
  authRequest: AuthRequest,
  handleThen?: any,
  handleError?: any
) => {
  authService.login(authRequest).then(handleThen).catch(handleError);
};
